  return (
    <div className="header container">
      <div className="logo">
        {/* <img src={logo} alt="cards" className="logo" /> */}
      </div>
      <nav>
        <ul className="navigation">
          <Link to="/">
            <li>Home</li>
          </Link>
          <li>Cards</li>
          <li>Grammar</li>
          <li>Resources</li>
        </ul>
      </nav>
      <div className="contacts">
        <a href="tel:+78000000000">+7(800)-000-00-00</a>
      </div>
    </div>
  );
}
